CREATE TABLE IF NOT EXISTS `mango_constants` (
	`id` int(11) NOT NULL AUTO_INCREMENT,
	PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci AUTO_INCREMENT=1;
ALTER TABLE `mango_constants` ADD COLUMN `coop_fear_iterator` int(2) NOT NULL DEFAULT '1';
CREATE TABLE IF NOT EXISTS `mango_fear_images` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `identifier` int(4) NOT NULL,
  `subject` int(2) NOT NULL,
  `block` int(2) NOT NULL,
  `filename` varchar(25) CHARACTER SET utf8 NOT NULL,
  `identity` int(2) NOT NULL,
  `gender` int(2) NOT NULL,
  `gaze` int(2) NOT NULL,
  `direction` int(2) NOT NULL,
  `emotion` int(2) NOT NULL,
  `intensity` int(2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1;
